// @flow

type actionType = {
  type: string,
  token: any
};

export default function token(state: string = "ey2647ce7fd9b04245dbbcd4381bd45e1e2fdbe507c0fbb4e53afb9cc4bea7434c1fda116db2da4bc3ef534f16852..", action: actionType) {
  switch (action.type) {
    case "SET_TOKEN":
      return action.token;
    default:
      return state;
  }
}
